import React from 'react'

export default function List() {

    const names =['Bruce','Clark','Diana']
    return (
        <div>
        <h2>{names[0]}</h2>
        <h2>{names[1]}</h2>
        <h2>{names[2]}</h2>


        </div>
    )
}
